}));

const Results = (props) => {

	const {  strikes, classes, correctAnswers,  guesses } = props;

    return (
		<React.Fragment>                    
            <Container maxWidth="md"  >  

            {guesses.map((guess, index) => {   
                return correctAnswers.includes(guess) ? ( 
                    <div></div>
                ) :(
                    <Card  className= {classes.listResults}>
                        <CardContent className= {classes.listResults}>
                        <li className={classes.incorrect} key={index}>Strike {index+1} : {guess}</li>
                        </CardContent>
                    </Card>
                    )
                    })}
            </Container>  
        </React.Fragment>

    );
};

